import React from 'react';


function Pdf(){

    return (
        <div style={{position:'absolute',width:'100%',height:'100%'}} align="center">
            <object
             data={require('../front/Pdf.js')}
             type="application/pdf"
             width="100%"
             height="100%"
            >
                <a>ytcfyctc</a>
            </object>
        </div>
    );

}

export default Pdf;
